  .aspect-ratio--5x8-s {  padding-bottom: 160%; }
  .aspect-ratio--7x5-s {  padding-bottom: 71.42%; }
  .aspect-ratio--5x7-s {  padding-bottom: 140%; }
  .aspect-ratio--1x1-s {  padding-bottom: 100%; }
  .aspect-ratio--object-s {
      position: absolute;
      top: 0;
      right: 0;
      bottom: 0;
      left: 0;
      width: 100%;
      height: 100%;
      z-index: 100;
  }
}

@media (--breakpoint-medium) {
