/*!!!

# CLEARFIX

### Docs

http://tachyons.io/docs/layout/clearfix/

### Based on

Nicolas Gallagher's clerfix solution
http://nicolasgallagher.com/micro-clearfix-hack/

### Base

- c = clear

### Modifiers

- f = clearfix
- l = left
- r = right
- b = both
- n = none

### Media Query Extensions

- `-s` = small
- `-m` = medium
- `-l` = large
*/

.cf:before,
.cf:after { content: " "; display: table; }
.cf:after { clear: both; }
.cf {       *zoom: 1; }

.cl { clear: left; }
.cr { clear: right; }
.cb { clear: both; }
.cn { clear: none; }

@media (--breakpoint-small) {
  .cl-s { clear: left; }
