tachyons-tables.src:
/*!!!

# TABLES

### Docs

http://tachyons.io/docs/elements/tables/

### Base

- collapse = border collapse
- striped = striped table

### Modifiers
- `-light` = light stripes
- `-dark` = dark stripes
- `--light-silver` = light-silver stripes
- `--moon-gray` = moon-gray stripes
- `--light-gray` = light-gray stripes
- `--near-white` = near-white stripes
*/

.collapse {
    border-collapse: collapse;
    border-spacing: 0;
}

.striped--light-silver:nth-child(odd) {
  background-color: var(--light-silver);
}

.striped--moon-gray:nth-child(odd) {
  background-color: var(--moon-gray);
}

.striped--light-gray:nth-child(odd) {
  background-color: var(--light-gray);
}

.striped--near-white:nth-child(odd) {
  background-color: var(--near-white);
}

.stripe-light:nth-child(odd) {
  background-color: var(--white-10);
}

.stripe-dark:nth-child(odd) {
  background-color: var(--black-10);
}

tachyons-tables.css:
/*

  TABLES

*/
.collapse { border-collapse: collapse; border-spacing: 0; }
.striped--moon-gray:nth-child(odd) { background-color: #aaa; }
.striped--moon-gray:nth-child(odd) { background-color: #ccc; }
.striped--light-gray:nth-child(odd) { background-color: #eee; }
.striped--near-white:nth-child(odd) { background-color: #f4f4f4; }

tachyons-text-align.src:
/*!!!

# TEXT ALIGN

### Docs

http://tachyons.io/docs/typography/text-align/

### Base

t = text-align

### Modifiers

- l = left
- r = right
- c = center
- j = justify

### Media Query Extensions

- `-s` = small
- `-m` = medium
- `-l` = large
*/

.tl  { text-align: left; }
.tr  { text-align: right; }
.tc  { text-align: center; }
.tj  { text-align: justify; }

@media (--breakpoint-small) {
  .tl-s  { text-align: left; }
  .tr-s  { text-align: right; }
  .tc-s  { text-align: center; }
  .tj-s  { text-align: justify; }
}

@media (--breakpoint-medium) {
  .tl-m  { text-align: left; }
  .tr-m  { text-align: right; }
  .tc-m  { text-align: center; }
  .tj-m  { text-align: justify; }
}

@media (--breakpoint-large) {
  .tl-l  { text-align: left; }
  .tr-l  { text-align: right; }
  .tc-l  { text-align: center; }
  .tj-l  { text-align: justify; }
}

